(function() {
  jQuery(function() {
    $('#s3_uploader').S3Uploader({
      remove_completed_progress_bar: true,
      progress_bar_target: $('.js-progress-bars')
    });
    $('#s3_uploader').bind('s3_upload_failed', function(e, content) {
      return alert(content.filename + ' failed to upload');
    });
    $('#s3_uploader').bind('s3_upload_complete', function(e, content) {
      $('#direct_upload_url').val(content.url);
      $('#photo_image_file_name').val(content.filename);
      $('#photo_image_file_size').val(content.filesize);
      $('#photo_image_content_type').val(content.filetype);
      return window.uploadContent = content;
    });
    return $('[data-s3-trigger]').on('click', function() {
      var $targetEl;
      $targetEl = $($(this).data('s3-trigger'));
      return $targetEl.click();
    });
  });

}).call(this);
(function() {
  $(function() {
    var sortable_index;
    sortable_index = function(sortable_list, event_type) {
      sortable_list.each(function(index) {
        $.post('set_favorite_photo_order', {
          event_id: $(this).data('event-id'),
          photo_id: $(this).data('photo-id'),
          order: index,
          event_type: event_type
        });
      });
    };
    $('.sortable').sortable({
      connectWith: '.sortable',
      placeholder: 'drop-placeholder',
      forcePlaceholderSize: true
    });
    $('#sortable_favorites').on('sortupdate sortreceive', function(event, ui) {
      sortable_index($('#sortable_favorites').sortable('widget').children(), event.type);
    });
    $('#sortable_favorites').on('sortremove', function(event, ui) {
      sortable_index(ui.item, event.type);
    });
    $('#sortable_favorites, #sortable_other').disableSelection();
  });

}).call(this);
